    EmbeddingsResponse:
      type: object
      properties:
        object:
          description: 'The object type, which is always `list`.'
          enum:
            - list
          title: Object
          type: string
        data:
          items:
            $ref: '#/components/schemas/Embedding'
          type: array
          title: Data
          description: The list of embeddings generated by the model.
          maxItems: 64
          examples:
          - - embedding:
              - 0.1
              - 0.1
              - 0.1
              index: 0
              object: embedding
            - embedding:
              - 0.1
              - 0.1
              - 0.1
              index: 1
              object: embedding
        model:
          type: string
          description: Model used to generate embeddings.
          example: nvidia/nvdinov2-vit-g
          title: Model
          const: nvidia/nvdinov2-vit-g
        usage:
          $ref: '#/components/schemas/Usage'
          description: Usage statistics for the embeddings request.
          examples:
          - num_images: 1
      additionalProperties: false
      required:
        - object
        - data
        - usage
        - model
      title: EmbeddingsResponse
      description: Response schema for the inference request.
    Embedding:
      type: object
      description: Represents an embedding vector returned by embedding endpoint.
      properties:
        object:
          description: 'The object type, which is always `embedding`.'
          enum:
           - embedding
          title: Object
          type: string
        index:
          type: integer
          format: int32
          title: Index
          description: The index of the embedding in the list of embeddings.
          minimum: 0
          maximum: 127
        embedding:
          oneOf:
            - type: array
              description: |
                The embedding vector as a list of floats, The length of the vector depends on the model.
              items:
                type: number
              maxItems: 1536
            - type: string
              maxLength: 10240
              description: |
                The embedding vector as base64 string. The length of the vector depends on the model.
              format: ^(?:[A-Za-z0-9+/]{4})*(?:[A-Za-z0-9+/]{4}|[A-Za-z0-9+/]{3}=|[A-Za-z0-9+/]{2}==)$
          title: Embedding
      required:
        - index
        - object
        - embedding
      title: Embeddings
    Usage:
      properties:
        num_images:
          type: integer
          format: int32
          title: Num Images
          minimum: 0
          maximum: 64
          description: Number of images processed.
      additionalProperties: false
      type: object
      required:
        - num_images
      title: Usage
      description: Usage information for the inference request.
    Errors:
      properties:
        type:
          type: string
          format: "^.{1, 128}$"
          maxLength: 128
          description: Error type
        title:
          type: string
          format: "^.{1, 128}$"
          maxLength: 128
          description: Error title
        status:
          type: integer
          format: int32
          minimum: 100
          maximum: 999
          description: Error status code
        detail:
          type: string
          format: "^.{1, 1024}$"
          maxLength: 1024
          description: Detailed information about the error
        instance:
          type: string
          format: "^.{1, 256}$"
          maxLength: 256
          description: Function instance used to invoke the request
        requestId:
          type: string
          format: uuid
          maxLength: 36
          description: UUID of the request
      type: object
      required:
        - type
        - title
        - status
        - detail
        - instance
        - requestId
      title: InvokeError
